package com.github.unidbg.android;

import com.github.unidbg.arm.ARMEmulator;
import junit.framework.TestCase;
import net.fornwall.jelf.AndroidRelocationIterator;
import net.fornwall.jelf.ElfFile;
import net.fornwall.jelf.ElfRelocation;
import org.apache.commons.codec.binary.Hex;
import org.slf4j.Logger;
import org.slf4j.LoggerFactory;

import java.nio.ByteBuffer;

public class AndroidRelocationTest extends TestCase {

    private static final Logger log = LoggerFactory.getLogger(AndroidRelocationTest.class);

    private static int arm_expand_prel31(int word, int where) {
        int offset;

        offset = word & 0x7fffffff;
        if ((offset & 0x40000000) != 0)
            offset |= ~0x7fffffff;

        return offset + where;
    }

    public void testArmExIdx() {
        int value = 0x7ffd0344;
        System.out.println(arm_expand_prel31(value, 0));
        System.out.println((value << 1 >> 1) + 0x3d938);
        System.out.println("0x" + Integer.toHexString(arm_expand_prel31(value, 0x3d938)));
        System.out.println("0x" + Integer.toHexString(0x3d938 + 0x8d4c));
    }

    public void test64() throws Exception {
        byte[] data = Hex.decodeHex("".toCharArray());
        AndroidRelocationIterator iterator = new AndroidRelocationIterator(ElfFile.CLASS_64, null, ByteBuffer.wrap(data), true);
        while (iterator.hasNext()) {
            ElfRelocation relocation = iterator.next().getValue();
            int type = relocation.type();
            switch (type) {
                case ARMEmulator.R_AARCH64_ABS64:
                case ARMEmulator.R_AARCH64_COPY:
                case ARMEmulator.R_AARCH64_GLOB_DAT:
                case ARMEmulator.R_AARCH64_JUMP_SLOT:
                case ARMEmulator.R_AARCH64_RELATIVE:
                case ARMEmulator.R_AARCH64_TLS_TPREL64:
                case ARMEmulator.R_AARCH64_TLS_DTPREL32:
                case ARMEmulator.R_AARCH64_IRELATIVE:
                case ARMEmulator.R_AARCH64_ABS32:
                case ARMEmulator.R_AARCH64_ABS16:
                case ARMEmulator.R_AARCH64_PREL64:
                case ARMEmulator.R_AARCH64_PREL32:
                case ARMEmulator.R_AARCH64_PREL16:
                    break;
                default:
                    log.debug("type={}, offset=0x{}, addend=0x{}, symbol={}", type, Long.toHexString(relocation.offset()), Long.toHexString(relocation.addend()), relocation.sym());
                    break;
            }
        }
    }

    public void test32() throws Exception {
        byte[] data = Hex.decodeHex("".toCharArray());
        AndroidRelocationIterator iterator = new AndroidRelocationIterator(ElfFile.CLASS_32, null, ByteBuffer.wrap(data), false);
        while (iterator.hasNext()) {
            ElfRelocation relocation = iterator.next().getValue();
            int type = relocation.type();
            switch (type) {
                case ARMEmulator.R_ARM_ABS32:
                case ARMEmulator.R_ARM_REL32:
                case ARMEmulator.R_ARM_GLOB_DAT:
                case ARMEmulator.R_ARM_JUMP_SLOT:
                case ARMEmulator.R_ARM_RELATIVE:
                case ARMEmulator.R_ARM_IRELATIVE:
                case ARMEmulator.R_ARM_COPY:
                    break;
                default:
                    log.debug("test32 type={}, offset=0x{}, addend=0x{}, symbol={}", type, Long.toHexString(relocation.offset()), Long.toHexString(relocation.addend()), relocation.sym());
                    break;
            }
        }
    }

}
